window.bookSummaryJSON = "<i>New York Times</i> best-selling author Diana Gabaldon enchanted scores of fans with <i>Outlander</i>, her electrifying historical saga set in 18th-century Scotland. Now the sequel sweeps listeners back into the past as Claire relates more of her perilous sojourn there with her Scottish warrior husband, James Fraser. Twenty years after her strange journey back in time, Claire has returned to Scotland with her daughter, determined to share with her the secret she has harbored since her time travel. Still longing to know the fate of her beloved warrior, she recounts the story of her stay with him in the intrigue-ridden court of Charles Stuart and their attempt to avert the doomed Highlands uprising at Culloden. As her story unfolds, it reveals implications more far-reaching than even Claire could have guessed.<p>Narrator Davina Porter's gift for expression captures the history and flavor of a harsh place and time, and gives it the polish of a warm and engaging love story.</p>"; 
